func (c *sysstatCollector) Update(db *sql.DB, ch chan<- prometheus.Metric) error {
	rows, err := db.Query(sysstatSQL)
	if err != nil {
		return err
	}
	defer rows.Close()

	for rows.Next() {
		var statID int
		var class string
		var value float64
		if err := rows.Scan(&statID, &value, &class); err != nil {
			return err
		}

		desc, ok := c.descs[statID]

		if ok {
			ch <- prometheus.MustNewConstMetric(desc, prometheus.CounterValue, value, class)
		} else {
			return errors.New(fmt.Sprintf("sysstat id: %d no exist", statID))
		}

	}
	return nil
}

const sysstatSQL = `
SELECT stat_id, value,
			 decode(class, 1, 'User', 2, 'Read', 4, 'Enqueue', 8, 'Cache',  16, 'OS', 32, 'Real Application Clusters', 64, 'SQL', 128, 'Debug', 'null')
  FROM v$sysstat WHERE value >= 1`
